import React from 'react';
import './Projects.css';

const Projects = () => {
  return (
    <div className="projects">
      <h1>Projects</h1>
      <div className="projects-content">
        <p>Project management interface coming soon...</p>
      </div>
    </div>
  );
};

export default Projects;
